package com.example.prescription_module.domain;import jakarta.persistence.*;import java.sql.Timestamp;import java.util.HashSet;import java.util.Set;import lombok.Getter;import lombok.Setter;@Entitypublic class PrescriptionHistory {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private Long idPatient;    private Long idDoctor;    private Timestamp timestamp;    @ManyToMany    private Set<Medication> medications = new HashSet<>();    public PrescriptionHistory() {    }    public PrescriptionHistory(Long idPatient, Long idDoctor, Timestamp timestamp, Set<Medication> medications) {        this.idPatient = idPatient;        this.idDoctor = idDoctor;        this.timestamp = timestamp;        this.medications = medications;    }    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public Long getIdPatient() {        return this.idPatient;    }    public void setIdPatient(Long idPatient) {        this.idPatient = idPatient;    }    public Long getIdDoctor() {        return this.idDoctor;    }    public void setIdDoctor(Long idDoctor) {        this.idDoctor = idDoctor;    }    public Timestamp getTimestamp() {        return this.timestamp;    }    public void setTimestamp(Timestamp timestamp) {        this.timestamp = timestamp;    }    public Set<Medication> getMedications() {        return this.medications;    }    public void setMedications(Set<Medication> medications) {        this.medications = medications;    }}